import React from 'react'
import {useNavigate } from 'react-router-dom';
const Landing = () => {

    let navigate = useNavigate();

    if(localStorage.token)
    {
        return(
            <div>
                Landing
            </div>
        );
    }
    else {
        return navigate("/Login");
    }
    localStorage.clear();
}

export default Landing;
